import React from 'react';
import Sidebar from './Sidebar';
import InfoCard from './InfoCard';
import { FaUsers, FaChalkboardTeacher, FaRoute, FaBuilding } from 'react-icons/fa';
import styles from './CoordinatorDashboard.module.css';

const Dashboard = () => {
  const dummyData = [
    {
      title: 'Advisors',
      value: 34,
      icon: <FaUsers style={{ backgroundColor: '#e0a800' }} />, // Gold icon background
    },
    {
      title: 'Guides',
      value: 53,
      icon: <FaChalkboardTeacher style={{ backgroundColor: '#20c997' }} />, // Green icon background
    },
    {
      title: 'Tours',
      value: 49,
      icon: <FaRoute style={{ backgroundColor: '#007bff' }} />, // Blue icon background
    },
    {
      title: 'Fairs',
      value: 9,
      icon: <FaBuilding style={{ backgroundColor: '#6610f2' }} />, // Purple icon background
    },
  ];

  return (
    <div className={styles.dashboard}>
      {/* Sidebar */}
      <Sidebar />

      {/* Main Content */}
      <div className={styles.mainContent}>
        <h1 className={styles.dashboardTitle}>Dashboard</h1>

        {/* InfoCards Section */}
        <div className={styles.infoCardsContainer}>
          {dummyData.map((data, index) => (
            <InfoCard
              key={index}
              title={data.title}
              value={data.value}
              icon={data.icon}
            />
          ))}
        </div>

        {/* Placeholder for other content */}
        <div className={styles.extraContent}>
          <p>More content will go here...</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
